import React from 'react';
import { BrowserRouter } from 'react-router-dom';
import AppRouter from './components/Approuter';
import Navabar from './UI/Navabar/Navabar';
import cl from "./style/App.module.css"

function App() {
  return (
    <div class={cl.app} className="App">
  <BrowserRouter>
  <Navabar/>
  <AppRouter/>
  </BrowserRouter>
    </div>
  );
}

export default App;
